        // Function to render the data to the page
        function renderData(data) {
            const container = document.getElementById('resultsContainer');
            container.innerHTML = '';  // Clear previous results
            if (data.length === 0) {
                container.innerHTML = '<p class="no-results">No results found</p>';
                return;
            }
            data.forEach(item => {
                const div = document.createElement('div');
                div.classList.add('result-item');
                div.innerHTML = `
                    <h4>${item['Institute Name']}</h4>
                    <p><strong>Program:</strong> ${item['Program Name']}</p>
                    <p><strong>Quota:</strong> ${item['Quota Description']}</p>
                    <p><strong>Institute ID:</strong> ${item['Institute ID']}</p>
                    <p><strong>Institute Type:</strong> ${item['Institute Type']}</p>
                    <p><strong>Address:</strong> ${item['Institute Address']}</p>
                `;
                container.appendChild(div);
            });
        }

        // Initial render of all data
        renderData(jsonData);

        // Function to search and filter the data
        function searchData() {
            const query = document.getElementById('searchBar').value.toLowerCase();
            const filteredData = jsonData.filter(item => {
                return item['Institute Name'].toLowerCase().includes(query) ||
                    item['Program Name'].toLowerCase().includes(query) ||
                    item['Quota Description'].toLowerCase().includes(query) ||
                    item['Institute Address'].toLowerCase().includes(query);  // Include address in search
            });
            renderData(filteredData);
        }
    </script>
